import ReactDOM from 'react-dom/client';
import  App from './App'
import  MyComponent from './cbc'
import MC from './fbc';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
  <MyComponent name="guru" />
  <div className="App">
      <Mc />
  </div>
  <App/>
  </React.StrictMode>
);
